import React from "react";
import './phones.css'

const Mobiles = ({ mobiles }) =>{
    return (
        <div>
          <center><h1>List of available mobiles</h1></center>
          {mobiles.map((mobile) => (
            <div class="mobile">
                <h1>{mobile.id}</h1>
            </div>
          ))}
        </div>
    )
}

export default Mobiles;
